import React,{ Component } from 'react'
import { UserConsumer } from './ContextMain';

 class CompnentThree extends Component {
    
  render() {
    return (
        <UserConsumer>{
            (username)=>{
                return(
                <div>                    
                        <h1>Welcome From ComponentThree-----------{username}</h1>
                    </div>             
                       )
            }
            }
    </UserConsumer>
    )
  }
}

export default CompnentThree;
